import { useState } from 'react';
import styles from './SplitTTER.module.css'

export default function Split() {

  const [bill, setBill] = useState("")
  const [tip,setTip] = useState("")
  const [numberOfPeople, setNumberOfPeople] = useState("")

  const handleBillChange = (e) => {
      const value = e.target.value

      if (value != none){
      setBill(value);
      console.log("Bill Value:", value);
      } else{
        console.log(e);

      }
  }

  const handleTipChange = (e) => {
    const value = e.target.value
    setTip(value)
    console.log("Custom Tip Value: ", value);
    console.log("_________");
  }





  return (
    <div >
      <h1>SPLIT TTER</h1>
     <div className={styles.container}>    
      <div  className={styles.containerFirstchild}>
          <div className="bill">
            <laber className={styles.bill}>Bill</laber>
            <br/>
            <input 
                  type="text" 
                  name="text"   
                  className={styles.money} 
                  value={bill}
                  onChange={handleBillChange}
            />
          </div>

          <div className="Select Tip %">
                <label htmlFor="" className={styles.tip}>Selet Tip %</label>
               <div className={styles.grid}> 
                <button className={styles.box} onClick={handleTipChange}>5%</button>
                <button className={styles.box} onClick={() => setTip(10)}>10%</button>
                <button className={styles.box} onClick={() => setTip(15)}>15%</button>
                <button className={styles.box} onClick={() => setTip(25)}>25%</button>
                <button className={styles.box} onClick={() => setTip(50)}>50%</button>

                <input 
                  className={styles.boxinput}  
                  type="text" 
                  name="text" 
                  placeholder="Custom"
                  value={tip}
                  onChange={handleTipChange}
                  />
                </div>
          </div>

          <div className={styles.numberOfpeople}>
                <label htmlFor="" className={styles.peopleNum}>Number Of People</label><br/>
                <input type="text" name="text" id=""   className={styles.peopleInput}/>
          </div>

        </div>
          <div className={styles.containerSecondchild}>
             <div className={styles.firstItemcontainer}>

              <div>
                <span className={styles.mount}>Tip amount</span>
                <span className={styles.person}>/ person</span>
              </div>
                <h3>$0.00</h3>
             </div>

             <div className={styles.secondItemcontainer}>
             <div>
                <span className={styles.mount}>Tip amount</span>
                <span className={styles.person}>/ person</span>
              </div>
                <h3>$0.00</h3>
             </div>

             <div className={styles.rest}>
                  <button className={styles.btn}>Reset</button>
              </div>
          </div>

      </div>
    </div>
  );
}
